CREATE TABLE "Stock" (
  "ID" double precision,
  "Источник" text,
  "Проверено_(да/нет)" text NULL,
  "Проверяющий" text NULL,
  "Тип_клапана" text,
  "Чертеж_клапана" text NULL,
  "Количество_участков" double precision NULL,
  "Чертеж_буксы" text NULL,
  "Чертеж_штока" text NULL,
  "Диаметр_штока_мм" double precision NULL,
  "Точность_изготовления_штока_мм" double precision NULL,
  "Точность_изготовления_буксы_мм" double precision NULL,
  "Расчетный_зазор_мм" double precision NULL,
  "Длина_участка_1_мм" double precision NULL,
  "Длина_участка_2_мм" double precision NULL,
  "Длина_участка_3_мм" double precision NULL,
  "Длина_участка_4_мм" text NULL,
  "Длина_участка_5_мм" text NULL,
  "Радиус_скругления_размер_фаски_мм" double precision NULL
);

